package com.ucontrol.dapweb.entity;import com.ucontrol.dapweb.utils.DateTimeTools;import java.text.ParseException;public class Point {    public Point(String influxTime, String influxQuality, Double influxValue){        this.influxTime = influxTime;        this.influxQuality = influxQuality;        this.influxValue = influxValue;        timeTrans();    }    private String influxTime;    private String influxQuality;    private Double influxValue;    private long longTime;    private void timeTrans(){        String format = "yyyy-MM-dd HH:mm:ss";        String[] timeformat = influxTime.split("Z")[0].split("T");        String newTime = timeformat[0] + " " + timeformat[1];        try {            long time = DateTimeTools.StringToLong(newTime, format);            this.longTime = time;        } catch (ParseException e) {            e.printStackTrace();        }    }    public String getInfluxTime() {        return influxTime;    }    public void setInfluxTime(String influxTime) {        this.influxTime = influxTime;    }    public String getInfluxQuality() {        return influxQuality;    }    public void setInfluxQuality(String influxQuality) {        this.influxQuality = influxQuality;    }    public Double getInfluxValue() {        return influxValue;    }    public void setInfluxValue(Double influxValue) {        this.influxValue = influxValue;    }    public long getLongTime() {        return longTime;    }    public void setLongTime(long longTime) {        this.longTime = longTime;    }}